import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from "./pages/Home.js";
import SearchRecipe from "./pages/SearchRecipe.js";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route exact path="/searchRecipes">
          <SearchRecipe />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
